import React from 'react'
import {
    Link,
    NavLink
} from 'react-router-dom'

const Header = () => {
    return (
        <nav className='navbar navbar-expand-g navbar-light bg-light'>
            <NavLink to='/'>Home</NavLink>
            <NavLink to='/about'>About</NavLink>
            <NavLink to='/myworkspace'>My Workspace</NavLink>
            <Link to={process.env.PUBLIC_URL + '/assets/files/Resume.pdf'}>Resume</Link>
        </nav>
    )
}

export default Header
